 stroke:red;

<script>

    function drawVerticalLines(chart) {

      // CAREFUL HERE !!! the css path ".nvd3 .nv-focus .nv-linesWrap" depends on the type of chart you are using, lineChart would use only ".nvd3 .nv-linesWrap" ... !
      if (!(d3.select('#chart1 .nvd3 .nv-focus .nv-linesWrap').select('.vertical-lines')[0][0])) {
        // Adds new g element with .vertical-lines class; use a css debugger to verify
        d3.select('#chart1 .nvd3 .nv-focus .nv-linesWrap').append('g')
          .attr('class', 'vertical-lines')
      }

      vertLines = d3.select('#chart1 .nvd3 .nv-focus .nv-linesWrap').select('.vertical-lines').selectAll('.vertical-line')
        .data(
          // [USER INPUT] : Specify events here
          [{
            'date': new Date('2016-10-30'),
            'label': 'something to highlight 2016'
          }, {
            'date': new Date('2017-01-30'),
            'label': 'something to highlight 2017'
          }])

      var vertG = vertLines.enter()
        .append('g')
        .attr('class', 'vertical-line')

      vertG.append('svg:line')
      vertG.append('text')

      vertLines.exit().remove()

      // CAREFUL 2 : chart.xAxis.scale() scale depends how you are defining your x Axis in nvd3 chart ... if your are using timestamps, (d.date / 60 / 60 / 24 / 1000) becomes (d.date)

      vertLines.selectAll('line')
        .attr('x1', function(d) {
          return chart.xAxis.scale()(d.date.getTime()/1000 + 168300)
        })
        .attr('x2', function(d) {
          return chart.xAxis.scale()(d.date.getTime()/1000 + 168300)
        })
        .attr('y1', chart.yAxis.scale().range()[0])
        .attr('y2', chart.yAxis.scale().range()[1])
        .style('stroke', 'red')

      vertLines.selectAll('text')
        .text(function(d) {
          return d.label
        })
        .attr('dy', '1em')
        //x placement ; change dy above for minor adjustments but mainly
        //    change the d.date/60/60/24/1000 
        //y placement ; change 2 to where you want vertical placement
        //rotate -90 but feel free to change to what you would like
        .attr('transform', function(d) {
          return 'translate(' +
            chart.xAxis.scale()(d.date.getTime()/1000 + 168300) +
            ',' +
            chart.yAxis.scale()(2) +
            ') rotate(-90)'
        })
        //also you can style however you would like
        //here is an example changing the font size
        .style('font-size', '80%')

    }
    
    var sharedChart = null;
    
    // Wrapping in nv.addGraph allows for '0 timeout render', stores rendered charts in nv.graphs,
    // and may do more in the future... it's NOT required
    nv.addGraph(function() {
        var chart = nv.models.lineWithFocusChart()
            .useInteractiveGuideline(true)
            .x(function(d) { return d[0] })
            .y(function(d) { return d[1] })
            .color(d3.scale.category10().range())
            .duration(10)
            .clipVoronoi(false);
        chart.dispatch.on('renderEnd', function() {
            console.log('render complete: cumulative line with guide line');
        });

        chart.xAxis.tickFormat(function(d) {
            return d3.time.format('%d %b %y')(new Date(d * 1000 + 1683000000000))
        });
	chart.yAxis.axisLabel("Nombre d'articles")
	chart.x2Axis.tickFormat(function(d) {
            return d3.time.format('%d %b %y')(new Date(d * 1000 + 1683000000000))
        });
        chart.yAxis.tickFormat(d3.format('.2n'));

        d3.select('#chart1 svg')
            .datum(cumulativeTestData())
            .call(chart);

        //TODO: Figure out a good way to do this automatically
        nv.utils.windowResize(chart.update);

        chart.dispatch.on('stateChange', function(e) { nv.log('New State:', JSON.stringify(e)); });
        chart.state.dispatch.on('change', function(state){
            nv.log('state', JSON.stringify(state));
        });
chart.brushExtent([2950642800,2964470400])
chart.update()
        
        sharedChart = chart;
        return chart;
    }, //now the callback
        function() {
        drawVerticalLines(sharedChart);
    });
